import React from 'react';

const Header = () => {
   return (
      <header>
         <nav>
            <ul>
               <li>
                  <a href="/">Home</a>
               </li>
            </ul>
            <div>
               <select>
                  <option value="en">English</option>
                  <option value="es">Español</option>
                  <option value="fr">Français</option>
               </select>
            </div>
         </nav>
      </header>
   );
};

export default Header;
